    public void images() throws MalformedURLException, IOException {

        String fichero = "C:\\Users\\Tesis\\Desktop\\archivo.txt";
        String url = "";
        try {
            FileReader fr = new FileReader(fichero);
            BufferedReader br = new BufferedReader(fr);

            String linea;
            while ((linea = br.readLine()) != null) {
                url = url + linea;
            }
            fr.close();

        } catch (Exception e) {
            System.out.println("Excepcion leyendo fichero " + fichero + ": " + e);
        }

        String[] parts = url.split("data:image/png;base64,");

        for (int j = 1; j < parts.length; j++) {
            //convert base64 string to binary data
            byte[] data = DatatypeConverter.parseBase64Binary(parts[j]);
            String path = "C:\\Users\\Tesis\\Desktop\\test_image" + j + ".png";
            File file = new File(path);
            try (OutputStream outputStream = new BufferedOutputStream(new FileOutputStream(file))) {
                outputStream.write(data);
            } catch (IOException e) {
                e.printStackTrace();
            }
        }
        JPanel panel = new JPanel();

            for (int i = 1; i <= 8; i++) {
            ImageIcon icon = new ImageIcon("C:\\Users\\Tesis\\Desktop\\test_image" + i + ".png");
            String nombre = String.valueOf(i);
            JLabel templabel = new JLabel(nombre);
            templabel.setSize(300, 300);
            System.out.println(templabel.getHeight());
            
            Icon icono = new ImageIcon(icon.getImage().getScaledInstance(templabel.getWidth(), templabel.getHeight(), Image.SCALE_DEFAULT));
            templabel.setIcon(icono);
            panel.add(templabel);
            
        }
        

    }

